INSERT INTO news VALUES('1', '0', '2', 'Vinaphone khuy?n m?i 50% ngy vng 18/03/2014', 'http://pay123.vn/theme/images/vina.jpg', 'Ch??ng trnh khuy?n m?i c?a Vinaphone', '<p>Thu&ecirc; bao tr? tr??c ?ang ho?t ??ng n?p th? trong th?i gian KM:</p>\n<p>- T?ng 50% gi&aacute; tr? th? n?p, trong ?&oacute; 25% gi&aacute; tr? th? n?p c?ng v&agrave;o t&agrave;i kho?n KM (g?i &amp; nh?n tin li&ecirc;n m?ng), 25% gi&aacute; tr? th? n?p c?ng v&agrave;o t&agrave;i kho?n KM1 (g?i &amp; nh?n tin n?i m?ng VNPT).</p>\n<p>- T?ng th&ecirc;m 100% ng&agrave;y s? d?ng c?a th? cho c&aacute;c thu&ecirc; bao VinaCard, Vina365, VinaText::</p>\n<p>Stt M?nh gi&aacute; th? n?p Th?i h?n s? d?ng c?a m?nh gi&aacute; n?p ti?n KM t?ng ng&agrave;y s? d?ng n?p th? trong ??t KM T?ng c?ng ng&agrave;y s? d?ng n?p th? trong ??t KM</p>\n<p>- Thu&ecirc; bao tr? tr??c ?ang ho?t ??ng, c&oacute; ph&aacute;t sinh c??c trong tha?ng 10 va? 11/2013, kh&ocirc;ng na?p the? t?? 1/10 cho ?&ecirc;?n h&ecirc;?t 24/11: ngo&agrave;i vi?c ???c h??ng KM theo n?i dung n&ecirc;u tr&ecirc;n, c&ograve;n ???c t?ng th&ecirc;m 10.000 ??ng v&agrave;o TK KM2 n?u n?p th? t? 20.000 tr? l&ecirc;n.</p>\n<p>??i v?i c&aacute;c thu&ecirc; bao ?ang ???c h??ng khuy?n m?i n?p th? c?a c&aacute;c ch??ng tr&igrave;nh khuy?n m?i cho thu&ecirc; bao tr? tr??c h&ograve;a m?ng m?i (KM tr??c), n?u:</p>\n<p>- N?p ?? s? l??ng th? ???c khuy?n m?i c?a c&aacute;c ch??ng tr&igrave;nh KM tr??c: ti?p t?c ???c h??ng khuy?n m?i c?a &nbsp;ng&agrave;y V&agrave;ng.</p>\n<p>- Ch?a n?p ho?c ch?a n?p ?? s? l??ng th? ???c khuy?n m?i c?a ch??ng tr&igrave;nh KM tr??c, n?u n?p th? trong &nbsp;ng&agrave;y V&agrave;ng: s? ???c h??ng khuy?n m?i c?a ch??ng tr&igrave;nh c&oacute; gi&aacute; tr? KM l?n h?n. S? l??ng th? n?p trong th?i gian KM ng&agrave;y V&agrave;ng s? c?ng g?p v&agrave;o s? l??ng v&agrave;o th? n?p c?a ch??ng tr&igrave;nh KM tr??c.</p>\n<p>T? 00h00 ng&agrave;y 18/03/2014 tr? ?i:</p>\n<p>- N?u thu&ecirc; bao ch?a n?p ?? s? l??ng th? ??u ti&ecirc;n ???c KM, s? ti