INSERT INTO news VALUES('4', '0', '2', 'Viettel khuy?n m?i 50% t? 30/3 ??n h?t ngy 31/3/2014', 'http://pay123.vn/theme/images/viettel.jpg', 'Ch??ng trnh khuy?n m?i Viettel', '<p>T?&nbsp;<strong>00h00 ng&agrave;y 30/3</strong>&nbsp;??n&nbsp;<strong>23h59 ng&agrave;y 31/3/2014</strong>, Viettel khuy?n m&atilde;i t?ng&nbsp;<strong>50%</strong>&nbsp;gi&aacute; tr? th? n?p cho c&aacute;c thu&ecirc; bao tr? tr??c ?ang ho?t ??ng. Ch??ng tr&igrave;nh &aacute;p d?ng ??i v?i t?t c? c&aacute;c lo?i th? n?p, kh&ocirc;ng ph&acirc;n bi?t m?nh gi&aacute;.</p>\n<p>Ri&ecirc;ng ??i v?i c&aacute;c thu&ecirc; bao di ??ng tr? tr??c, s? ti?n khuy?n m&atilde;i (50% gi&aacute; tr? th? n?p) s? ???c c?ng v&agrave;o 2 t&agrave;i kho?n:</p>\n<p>- T?ng 25% gi&aacute; tr? th? n?p ???c c?ng v&agrave;o t&agrave;i kho?n khuy?n m&atilde;i (d&ugrave;ng n?i m?ng, ngo?i m?ng, Data).</p>\n<p>- T?ng 25% gi&aacute; tr? th? n?p ???c c?ng v&agrave;o t&agrave;i kho?n khuy?n m&atilde;i n?i m?ng (d&ugrave;ng tho?i v&agrave; SMS n?i m?ng).</p>\n<p>- ??i v?i c&aacute;c g&oacute;i c??c c&oacute; ng&agrave;y s? d?ng (Economy, Happy Zone), kh&ocirc;ng c?ng th&ecirc;m ng&agrave;y s? d?ng cho ph?n t&agrave;i kho?n t?ng th&ecirc;m, kh&aacute;ch h&agrave;ng ch? ???c c?ng ng&agrave;y s? d?ng t??ng ?ng v?i m?nh gi&aacute; th? n?p.</p>\n<p><strong>L?u &yacute;:</strong></p>\n<p>- ??i v?i nh?ng thu&ecirc; bao di ??ng tr? tr??c n?u ?ang ???c h??ng ch??ng tr&igrave;nh khuy?n m&atilde;i c?a c&aacute;c th? n?p ??u ti&ecirc;n, th&igrave; ch??ng tr&igrave;nh khuy?n m&atilde;i n&agrave;y ch? ???c &aacute;p d?ng sau khi thu&ecirc; bao ?&atilde; h??ng h?t khuy?n m&atilde;i c?a c&aacute;c th? ?&oacute;.</p>\n<p>- Ri&ecirc;ng g&oacute;i Tourist sim Sea+ v&agrave; v&agrave; D-com TT (Laptop easy XNK, Laptop easy VIP) ???c h??ng khuy?n m&atilde;i n?p th? theo t&iacute;nh n?ng c?a g&oacute;i c??c.</p>');
