DROP TABLE IF EXISTS cart;
CREATE TABLE cart (
   id int(11) NOT NULL auto_increment,
   loai varchar(50) NOT NULL,
   seri varchar(150) NOT NULL,
   ma varchar(150) NOT NULL,
   ngaynhap int(10) NOT NULL,
   ngayxuat int(10),
   user_id int(10),
   gia int(8),
   user_id_hold int(10),
   time_hold int(10) NOT NULL,
   orderId int(10) NOT NULL,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS cart_count;
CREATE TABLE cart_count (
   id int(5) unsigned zerofill NOT NULL auto_increment,
   time int(10) NOT NULL,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS ci_sessions;
CREATE TABLE ci_sessions (
   session_id varchar(40) NOT NULL,
   ip_address varchar(16) NOT NULL,
   user_agent varchar(150) NOT NULL,
   last_activity int(10) unsigned NOT NULL,
   user_data text NOT NULL,
   PRIMARY KEY (session_id)
);


DROP TABLE IF EXISTS history;
CREATE TABLE history (
   id int(10) NOT NULL auto_increment,
   user_id int(10) NOT NULL,
   rspCode text NOT NULL,
   orderId varchar(15) NOT NULL,
   amount varchar(15) NOT NULL,
   currCode varchar(50) NOT NULL,
   paymentMethod varchar(50) NOT NULL,
   vnpTranId varchar(50) NOT NULL,
   payDate varchar(50) NOT NULL,
   orderDesc varchar(500) NOT NULL,
   clientIp varchar(23) NOT NULL,
   additional_info text NOT NULL,
   log_time int(10) NOT NULL,
   PRIMARY KEY (id),
   KEY orderId (orderId)
);


DROP TABLE IF EXISTS log;
CREATE TABLE log (
   id int(10) NOT NULL auto_increment,
   time int(10) NOT NULL,
   content text NOT NULL,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS login_attempts;
CREATE TABLE login_attempts (
   id int(11) NOT NULL auto_increment,
   ip_address varchar(40) NOT NULL,
   login varchar(50) NOT NULL,
   time timestamp DEFAULT 'CURRENT_TIMESTAMP' NOT NULL on update CURRENT_TIMESTAMP,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS news;
CREATE TABLE news (
   id int(10) NOT NULL auto_increment,
   time int(10) NOT NULL,
   category_id tinyint(4) NOT NULL,
   title varchar(255) NOT NULL,
   image varchar(500) DEFAULT '/styles/images/no-image.png' NOT NULL,
   description varchar(500) NOT NULL,
   content text NOT NULL,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS news_category;
CREATE TABLE news_category (
   id tinyint(4) NOT NULL auto_increment,
   short_title varchar(100) NOT NULL,
   title varchar(255) NOT NULL,
   description varchar(255) NOT NULL,
   active tinyint(4) NOT NULL,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS user_autologin;
CREATE TABLE user_autologin (
   key_id char(32) NOT NULL,
   user_id int(11) NOT NULL,
   user_agent varchar(150) NOT NULL,
   last_ip varchar(40) NOT NULL,
   last_login timestamp DEFAULT 'CURRENT_TIMESTAMP' NOT NULL on update CURRENT_TIMESTAMP,
   PRIMARY KEY (key_id,user_id)
);


DROP TABLE IF EXISTS user_profiles;
CREATE TABLE user_profiles (
   id int(11) NOT NULL auto_increment,
   user_id int(11) NOT NULL,
   credit int(7) NOT NULL,
   PRIMARY KEY (id)
);


DROP TABLE IF EXISTS users;
CREATE TABLE users (
   id int(11) NOT NULL auto_increment,
   credit varchar(12) DEFAULT 'FETJ' NOT NULL,
   username varchar(50) NOT NULL,
   password varchar(255) NOT NULL,
   email varchar(100) NOT NULL,
   phone varchar(13) NOT NULL,
   activated tinyint(1) DEFAULT '1' NOT NULL,
   banned tinyint(1) NOT NULL,
   ban_reason varchar(255),
   new_password_key varchar(50),
   new_password_requested datetime,
   new_email varchar(100),
   new_email_key varchar(50),
   last_ip varchar(40) NOT NULL,
   last_login datetime DEFAULT '0000-00-00 00:00:00' NOT NULL,
   created datetime DEFAULT '0000-00-00 00:00:00' NOT NULL,
   modified timestamp DEFAULT 'CURRENT_TIMESTAMP' NOT NULL on update CURRENT_TIMESTAMP,
   PRIMARY KEY (id)
);


